    return (
        <AppBar position='fixed' className={classes.appbar} style={{backgroundColor:'#1B224A'}}>
            <Toolbar>
            <img src={logo} alt='commerce.js'height="35px"  />
                <Typography component={Link} to='/product' variant='h6' className={classes.title}>
                   E-CART
